import crud from "./elementCRUD"


var vdom = { children: undefined }
const objectCompare = (obj1, obj2) => {
  if (obj1 === null || obj1 === undefined || obj2 === null || obj2 === undefined) return true
  const changed = Object.keys(obj1).some((k, i) => {
    if (k == "__uniqueid") return false
    if (obj2[k] === null || obj2[k] === undefined) return true
    const t1 = typeof obj1[k]
    const t2 = typeof obj2[k]
    if (t1 !== t2) return true;
    if (t1 === "function" && obj1[k].toString() == obj2[k].toString()) return false;
    if (obj1[k] != obj2[k]) return true
  })

  return changed
}

export const compare = (newDom, root) => {
  console.log(newDom)
  const recursiveCompare = (nElm, vElm, parent) => {
    var creates = false;

    if (!vElm || !vElm.props) {
      vElm = {};
      creates = true;
      vElm.element = nElm.element ? nElm.element : crud.create(nElm.tag, nElm.props);
      vElm.props = nElm.props
      vElm.key = nElm.key
      vElm.children = []
    }

    if (objectCompare(vElm.props, nElm.props)) {
      vElm.props = nElm.props
      crud.update(vElm.element, nElm.props)
    }
    if (vElm.chilren) {
      const nChildrenKeys = nElm.children.map(({ key }) => key)
      vElm.children.forEach((child, index) => {
        if (nChildrenKeys.indexOf(child.key) == -1) {
          child.element.remove()
          vElm.children.splice(index, 1)
        }
      })

    }
    nElm?.children?.forEach((child, index) => {
      recursiveCompare(child, vElm.children[index], vElm, vElm.element)
    })
    if (creates) {
      parent.children = parent.children || []
      parent.children.push(vElm)
      parent.element.appendChild(vElm.element)
    }
    return vElm
  }

  vdom = recursiveCompare(newDom, vdom, { element: root });
}

const defaultReturn = {
  compare
};

export default defaultReturn;
